// Defining our projects

import project1 from '../assets/project1.png';
import project2 from '../assets/project2.png';
import project3 from '../assets/project3.png';

const PROJECTS = [
  {
    id: 1,
    title: 'Example React Applicaton',
    description:
      'A React App that I built, involving JS and core web dev concepts!',
    link: 'https://github.com',
    image: project1,
  },
  {
    id: 2,
    title: 'My API',
    description:
      'A REST API that I built from scratch with GET and POST requests',
    link: 'https://github.com',
    image: project2,
  },
  {
    id: 3,
    title: 'Herencia Farms',
    description: 'A web design project involving CSS and HTML',
    link: 'https://github.com',
    image: project3,
  },
];

export default PROJECTS;
